import React from 'react';
import SideNav from './components/SideNav';
import './App.css';

function App() {
  return (
    <div className="App">
      <SideNav />
      <main className="main-content">
        <div className="content-placeholder">
          <h1>Main Content Area</h1>
          <p>This is where your main content will be displayed.</p>
        </div>
      </main>
    </div>
  );
}

export default App;
